import {Typography} from "@mui/material";

export interface MyLibraryProps {

    body: React.ReactNode;
}

let useStyles = makeStyles({
    test: {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center'
    },
    SynopsisTypography:{
        lineHeight: "20.11px ",
